// src/Components/Partner/PartnerDetails.jsx
import React, { useRef } from 'react';
import './PartnerDetails.css';

function PartnerDetails({ partner, onFileUpload, onToggleFileAnonymization }) {
  const fileInputRef = useRef(null);

  const handleUploadButtonClick = () => {
    fileInputRef.current.click();
  };

  const handleFileChange = (event) => {
    const uploadedFiles = Array.from(event.target.files);
    if (uploadedFiles.length > 0) {
      onFileUpload(uploadedFiles);
    }
    event.target.value = null;
  };

  const handleDownloadAll = () => {
    alert(`Simulating "Download All" for ${partner.name}`);
    // In a real app, you'd trigger a backend endpoint to bundle and download files.
  };

  const handleSeeProfile = () => {
    alert(`Simulating "See Profile" for ${partner.name}`);
    // This could open another modal or navigate to a profile page.
  };

  const getFileTypeIcon = (fileType) => {
    // Basic icon representation based on file type
    if (fileType.includes('Tabular')) return '📊';
    if (fileType.includes('Text')) return '📄';
    if (fileType.includes('Image')) return '🖼️';
    if (fileType.includes('Document')) return '📁';
    return '❓'; // Default unknown
  };

  return (
    <div className="partner-details-container">
      <div className="partner-header-main">
        <div className="partner-info-main">
          <img src={partner.logo || '/icons/default_partner.svg'} alt={partner.name} className="partner-logo-main" />
          <h1>{partner.name}</h1>
        </div>
        <div className="header-actions">
          <button className="action-button" onClick={handleDownloadAll}>
            ⬇️ Download all
          </button>
          <button className="action-button" onClick={handleUploadButtonClick}>
            ⬆️ Upload file
          </button>
          <button className="action-button" onClick={handleSeeProfile}>
            👤 See Profile
          </button>
          {/* Hidden file input */}
          <input
            type="file"
            multiple // Allow multiple file selection
            ref={fileInputRef}
            onChange={handleFileChange}
            style={{ display: 'none' }}
          />
        </div>
      </div>

      <div className="file-list-section">
        <table>
          <thead>
            <tr>
              <th>Filename</th>
              <th>Type</th>
              <th>Switch</th> {/* Corresponds to the toggle checkbox */}
              <th>State</th>
              <th>Log</th> {/* This is the new column based on your screenshot */}
              <th>Download</th>
            </tr>
          </thead>
          <tbody>
            {Array.isArray(partner.files) && partner.files.length > 0 ? (
              partner.files.map(file => (
                <tr key={file.id}>
                  <td>
                    {getFileTypeIcon(file.type)} {file.filename}
                  </td>
                  <td>{file.type}</td>
                  <td>
                    <label className="switch">
                      <input
                        type="checkbox"
                        checked={file.state === 'Anonymized'} // 'Anonymized' is checked, 'De-anonymized' is unchecked
                        onChange={() => onToggleFileAnonymization(partner.id, file.id)}
                      />
                      <span className="slider round"></span>
                    </label>
                  </td>
                  <td>
                    <span className={`file-state ${file.state.toLowerCase().replace('-', '')}`}>
                      {file.state}
                    </span>
                  </td>
                  <td>
                    {/* Placeholder for the Log/View icon */}
                    <button className="log-icon-button" onClick={() => alert(`Simulating view log for ${file.filename}`)}>
                        👁️
                    </button>
                  </td>
                  <td>
                    <a href={file.downloadLink} download>
                      ⬇️
                    </a>
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="6" className="no-files-message">No files uploaded for this partner yet.</td> {/* Adjusted colspan */}
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default PartnerDetails;
